text:
Last year, I made a friendly wager with a certain New York Congressman that the @minnesotalynx would win the WNBA finals. The consequence if we lost? A speech on the House floor congratulating the New York Liberty.

@RepDanGoldman, today I gave you a floor speech, but not the one I promised.

Also @WNBA - it’s time to pay them what they deserve. (Yes, even the Liberty).

It’s estimated the cuts to food assistance programs by Washington Republicans will cost MN taxpayers an additional $259 million per year. 

@GovTimWalz is right. This bill does nothing to make life more affordable in MN – instead it just makes Minnesotans hungrier and sicker and you poorer. 

I’m voting NO.

For #MN02 residents currently in Lebanon:

@StateDept is telling Americans in Lebanon to submit the Crisis Intake Form linked below to help folks safely depart from the area. If you do not hear back within 24 hours, call my office at (651) 846-2120.

https://t.co/VLCT5uT4CA
